import React, { useState, useEffect, useCallback } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { quizAPI } from '../services/api';

const ResultPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  
  const [result, setResult] = useState(null);
  const [quiz, setQuiz] = useState(null);
  const [userAnswers] = useState([]);
  const [questions, setQuestions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [showDetails, setShowDetails] = useState(false);

  const fetchResultData = useCallback(async () => {
    try {
      const [resultResponse, quizResponse, questionsResponse] = await Promise.all([
        quizAPI.getResult(id),
        // Assume we get quizId from result
        quizAPI.getQuiz(id), // This might need adjustment based on your API
        quizAPI.getQuizQuestions(id) // This might need adjustment
      ]);
      
      setResult(resultResponse.data);
      setQuiz(quizResponse.data);
      setQuestions(questionsResponse.data);
      // Fetch user answers if available
      // setUserAnswers(userAnswersResponse.data);
    } catch (error) {
      setError('Error loading results');
      console.error('Error:', error);
    } finally {
      setLoading(false);
    }
  }, [id]);

  useEffect(() => {
    fetchResultData();
  }, [fetchResultData]);

  const getScorePercentage = () => {
    if (!result || !quiz) return 0;
    return Math.round((result.score / quiz.totalMarks) * 100);
  };

  const getScoreColor = () => {
    const percentage = getScorePercentage();
    if (percentage >= 80) return 'success';
    if (percentage >= 60) return 'warning';
    return 'danger';
  };

  const formatTime = (seconds) => {
    const minutes = Math.floor(seconds / 60);
    const remainingSeconds = seconds % 60;
    return `${minutes}m ${remainingSeconds}s`;
  };

  const getPerformanceMessage = () => {
    const percentage = getScorePercentage();
    if (percentage >= 90) return { message: "Excellent! Outstanding performance!", icon: "fas fa-trophy", color: "text-warning" };
    if (percentage >= 80) return { message: "Great job! Very good performance!", icon: "fas fa-star", color: "text-success" };
    if (percentage >= 70) return { message: "Good work! Above average performance!", icon: "fas fa-thumbs-up", color: "text-info" };
    if (percentage >= 60) return { message: "Fair performance. Keep practicing!", icon: "fas fa-hand-paper", color: "text-warning" };
    return { message: "Need improvement. Don't give up!", icon: "fas fa-heart", color: "text-danger" };
  };

  if (loading) {
    return (
      <div className="d-flex justify-content-center align-items-center" style={{ height: '80vh' }}>
        <div className="spinner-border text-primary" role="status">
          <span className="visually-hidden">Loading...</span>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mt-4">
        <div className="alert alert-danger" role="alert">
          <i className="fas fa-exclamation-triangle me-2"></i>
          {error}
        </div>
      </div>
    );
  }

  const performance = getPerformanceMessage();

  return (
    <div className="container mt-4">
      <div className="row justify-content-center">
        <div className="col-md-10">
          {/* Result Header */}
          <div className="card result-header-card mb-4">
            <div className="card-body text-center p-5">
              <i className={`${performance.icon} fa-4x ${performance.color} mb-4`}></i>
              <h1 className="card-title">Quiz Completed!</h1>
              <h2 className="quiz-title mb-3">{quiz?.title}</h2>
              <p className={`performance-message lead ${performance.color}`}>
                {performance.message}
              </p>
            </div>
          </div>

          {/* Score Card */}
          <div className="row mb-4">
            <div className="col-md-6">
              <div className="card h-100">
                <div className="card-body text-center">
                  <div className={`circular-progress circular-progress-${getScoreColor()}`}>
                    <div className="circular-progress-inner">
                      <div className="circular-progress-percentage">
                        {getScorePercentage()}%
                      </div>
                      <div className="circular-progress-label">Score</div>
                    </div>
                  </div>
                  <h4 className="mt-3">
                    {result?.score || 0} / {quiz?.totalMarks || questions.length}
                  </h4>
                  <p className="text-muted">Total Marks</p>
                </div>
              </div>
            </div>
            
            <div className="col-md-6">
              <div className="card h-100">
                <div className="card-body">
                  <h5 className="card-title">
                    <i className="fas fa-chart-bar me-2"></i>
                    Performance Summary
                  </h5>
                  
                  <div className="row text-center mt-4">
                    <div className="col-4">
                      <div className="performance-stat">
                        <h3 className="text-success">{result?.correctAnswers || 0}</h3>
                        <p className="text-muted mb-0">Correct</p>
                      </div>
                    </div>
                    <div className="col-4">
                      <div className="performance-stat">
                        <h3 className="text-danger">{result?.incorrectAnswers || 0}</h3>
                        <p className="text-muted mb-0">Incorrect</p>
                      </div>
                    </div>
                    <div className="col-4">
                      <div className="performance-stat">
                        <h3 className="text-warning">{result?.unanswered || 0}</h3>
                        <p className="text-muted mb-0">Skipped</p>
                      </div>
                    </div>
                  </div>
                  
                  <hr />
                  
                  <div className="d-flex justify-content-between align-items-center">
                    <span><i className="fas fa-clock me-2"></i>Time Taken:</span>
                    <strong>{formatTime(result?.timeTakenSeconds || 0)}</strong>
                  </div>
                  <div className="d-flex justify-content-between align-items-center mt-2">
                    <span><i className="fas fa-calendar me-2"></i>Completed:</span>
                    <strong>{new Date(result?.submittedAt).toLocaleString()}</strong>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Action Buttons */}
          <div className="row mb-4">
            <div className="col-12 text-center">
              <button
                className="btn btn-primary btn-lg me-3"
                onClick={() => setShowDetails(!showDetails)}
              >
                <i className="fas fa-eye me-2"></i>
                {showDetails ? 'Hide' : 'View'} Detailed Results
              </button>
              
              <button
                className="btn btn-outline-primary btn-lg me-3"
                onClick={() => navigate('/dashboard')}
              >
                <i className="fas fa-home me-2"></i>
                Back to Dashboard
              </button>
              
              <button
                className="btn btn-success btn-lg"
                onClick={() => navigate('/quizzes')}
              >
                <i className="fas fa-redo me-2"></i>
                Take Another Quiz
              </button>
            </div>
          </div>

          {/* Detailed Results */}
          {showDetails && (
            <div className="card">
              <div className="card-header">
                <h5 className="mb-0">
                  <i className="fas fa-list-alt me-2"></i>
                  Detailed Results
                </h5>
              </div>
              <div className="card-body">
                {questions.map((question, index) => {
                  const userAnswer = userAnswers.find(ua => ua.questionId === question.id);
                  const isCorrect = userAnswer?.selectedOption === question.correctAnswer;
                  const wasAnswered = userAnswer?.selectedOption;
                  
                  return (
                    <div key={question.id} className="question-result mb-4">
                      <div className="d-flex align-items-start">
                        <div className="flex-shrink-0 me-3">
                          <div className={`question-number ${isCorrect ? 'correct' : wasAnswered ? 'incorrect' : 'skipped'}`}>
                            {index + 1}
                          </div>
                        </div>
                        <div className="flex-grow-1">
                          <h6 className="question-text">{question.questionText}</h6>
                          
                          <div className="options mt-3">
                            {['A', 'B', 'C', 'D'].map((option) => {
                              const optionText = question[`option${option}`];
                              const isUserAnswer = userAnswer?.selectedOption === option;
                              const isCorrectAnswer = question.correctAnswer === option;
                              
                              let optionClass = 'option-item';
                              if (isCorrectAnswer) {
                                optionClass += ' correct-answer';
                              } else if (isUserAnswer && !isCorrectAnswer) {
                                optionClass += ' incorrect-answer';
                              }
                              
                              return (
                                <div key={option} className={optionClass}>
                                  <div className="d-flex align-items-center">
                                    <strong className="me-2">{option})</strong>
                                    <span>{optionText}</span>
                                    {isCorrectAnswer && (
                                      <i className="fas fa-check text-success ms-auto"></i>
                                    )}
                                    {isUserAnswer && !isCorrectAnswer && (
                                      <i className="fas fa-times text-danger ms-auto"></i>
                                    )}
                                    {isUserAnswer && isCorrectAnswer && (
                                      <i className="fas fa-check-double text-success ms-auto"></i>
                                    )}
                                  </div>
                                </div>
                              );
                            })}
                          </div>
                          
                          <div className="result-indicator mt-2">
                            {!wasAnswered ? (
                              <span className="badge bg-warning">
                                <i className="fas fa-minus me-1"></i>
                                Not Answered
                              </span>
                            ) : isCorrect ? (
                              <span className="badge bg-success">
                                <i className="fas fa-check me-1"></i>
                                Correct (+{question.marks || 1} mark{(question.marks || 1) > 1 ? 's' : ''})
                              </span>
                            ) : (
                              <span className="badge bg-danger">
                                <i className="fas fa-times me-1"></i>
                                Incorrect (0 marks)
                              </span>
                            )}
                          </div>
                        </div>
                      </div>
                    </div>
                  );
                })}
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default ResultPage;
